≪世帯の中に23歳未満の被扶養者がいる方≫
・被扶養者一覧表※
≪罹災証明書の判定が半壊で、やむを得ず住宅を解体された方≫
・被災した住宅の解体を証明する書類の写し（閉鎖事項証明書、被災家屋等の解体撤去完了通知書又は被災者生活再建支援金の交付決定通知書）
≪別居する扶養親族がいる方≫
・戸籍全部事項証明（戸籍謄本）又は戸籍個人事項証明（戸籍抄本）
・再建した住居に入居した日の属する年の前年の別居する扶養親族の所得課税証明書
≪世帯の中に障がい者又は特別障がい者がいる方≫
・身体障害者手帳、療育手帳、精神保健福祉手帳の写し（氏名、生年月日、障がいの程度が記載されている箇所）
≪申請者と融資を受けた方が異なる場合≫
・申請者と融資を受けた方の関係を示す書類（戸籍全部事項証明書等）
≪申請者以外の方に補助金の振込みをする場合≫
・申請者と補助金受領者の関係を示す書類（戸籍全部事項証明書等）
・委任状
≪店舗兼住宅等を建設又は購入し融資を受けた方≫
・建物の居住用に使用する部分の床面積と事業用に使用する部分の床面積を算出したもの
・建物の建設（購入）にかかる図面
・工事請負契約書又は不動産売買契約書
